// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract PaymentDistribution {
    struct ScheduledPayment {
        address payable recipient;
        uint256 amount;
        uint256 releaseTime;
        bool isCancelled;
    }

    mapping(address => uint256) private balances;
    mapping(address => ScheduledPayment) private scheduledPayments;

    // Function to deposit Ether to the user's balance
    function deposit() public payable {
        require(msg.value > 0, "Must send some Ether");
        balances[msg.sender] += msg.value;  // Update the sender's balance
    }
function makePaymentOrDeposit(address payable recipient, uint256 amount, bool isDeposit) public {
        if (isDeposit) {
            // Handle deposit
            require(amount > 0, "Must send some Ether");
            balances[msg.sender] += amount; // Increase sender's balance from msg.value
        } else {
            // Handle payment
            require(balances[msg.sender] >= amount, "Insufficient funds");
            balances[msg.sender] -= amount;
            balances[recipient] += amount;
        }
    }
    // Make a payment
    // function makePayment(address payable recipient, uint256 amount) public {
    //     require(balances[msg.sender] >= amount, "Insufficient funds");
    //     balances[msg.sender] -= amount;
    //     balances[recipient] += amount;
    // }

    // Schedule a payment
    // function schedulePayment(address payable recipient, uint256 amount, uint256 releaseTime) public {
    //     require(balances[msg.sender] >= amount, "Insufficient funds");
    //     require(releaseTime > block.timestamp, "Invalid time");

    //     scheduledPayments[msg.sender] = ScheduledPayment({
    //         recipient: recipient,
    //         amount: amount,
    //         releaseTime: releaseTime,
    //         isCancelled: false
    //     });
    // }

    // // Cancel a scheduled payment
    // function cancelPayment() public {
    //     require(!scheduledPayments[msg.sender].isCancelled, "Payment already cancelled");
    //     scheduledPayments[msg.sender].isCancelled = true;
    // }

    // Get balance
    function getBalance(address user) public view returns (uint256) {
        return balances[user];
    }
}

